import React from "react";
import axios from "axios";

class Newsapi extends React.Component {
  state = {
    articles: [],
    isLoading: true,
    errors: null
  };

  getArticles() {
    axios
      .get(
        "http://newsapi.org/v2/everything?q=ai&apiKey=XXXXXXXXX"
      )
      .then(response =>
        response.data.results.map(article => ({
          date: `${article.publishedAt}`,
          title: `${article.title}`,
          url: `${article.url}`
        }))
      )
      .then(articles => {
        this.setState({
          articles,
          isLoading: false
        });
      })
      .catch(error => this.setState({ error, isLoading: false }));
  }

  componentDidMount() {
    this.getArticles();
  }

  render() {
    const { isLoading, articles } = this.state;
    return (
      <React.Fragment>
        <h2>#AI</h2>
        <div>
          {!isLoading ? (
            articles.map(article => {
              const { date, title, url } = article;
              return (
                <div key={title}>
                  <p>{date}</p>
                  <p>{title}</p>
                  <p>{url}</p>
                </div>
                // <div key={title} className='col-4 mx-auto'>  
                // <div className="card-group">
                //   <div className="card">
                //     <img className='img-fluid' src={image} alt='Image' />
                //     <div className="card-body">
                //       <h4 className="card-title">{date}</h4>
                //       <h6 className="card-title">{title}</h6>
                //       <p className="card-text">{url}</p>
                //     </div>
                //   <div className="card-footer">
                //     <small className="text-muted">Last updated 3 mins ago</small>
                //   </div>
                // </div>
                // </div>
                // </div>
              );
            })
          ) : (
            <p>Loading...</p>
          )}
        </div>
      </React.Fragment>
    );
  }
}
export default Newsapi;
